// import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react'
import Navbar from './Components/Navbar';
import News from './Components/News';
// import NewsItem from './Components/NewsItem';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
// import { BrowserRouter as Router, Routes, Route } from "react-router-dom"
// import { Switch } from 'react-router-dom';

export default class App extends Component {
  render() {
    return (
      <>
      <Router>
      <Navbar />
      {/* <News pageSize = {8}  country= "in" category= "science" /> */}
      {/* <NewsItem/> */}

{/* Here below an individual key is used so that every link can be differentiated with each other. */}
      <Switch>
          <Route exact path="/"> <News pag key="general" country= "in" category= "general" /></Route>

          <Route exact path="/business"><News pag key="business" country="in" category="business"/></Route>

          <Route exact path="/entertainment"> <News pag key="entertainment" country= "in" category= "entertainment" /></Route>

          <Route exact path="/health"> <News pag key="health" country= "in" category= "health" /></Route>

          <Route exact path="/science"> <News pag key="Science" country= "in" category= "Science" /></Route>

          <Route exact path="/sports"> <News pag key="sports" country= "in" category= "sports" /></Route>

          <Route exact path="/technology"> <News pag key="technology" country= "in" category= "technology" /></Route>
        </Switch>

        </Router>
      </>
       )
  }
}
